"use client"

import { useContext } from "react"
import { AuthContext } from "./AuthContext"
import { Login } from "./Login"

export const PrivateRoute = ({ element }) => {
  const { isAuthenticated } = useContext(AuthContext)

  if (!isAuthenticated) {
    return <Login />
  }

  return element
}
